[Form]
public final class VendRORReturnNoteJournal extends FormRun
{
    InventDimCtrl_Frm_Mov   inventDimFormSetup;
    boolean                 refreshCaller;

    #define.TabLines(2)
}

public void close()
{
    FormDataSource      formDataSource;
    Common              record;

    super();

    if (refreshCaller
    &&  element.args()
    &&  element.args().record())
    {
        record = element.args().record();

        if (record
        &&  FormDataUtil::isFormDataSource(record))
        {
            formDataSource = FormDataUtil::getFormDataSource(element.args().record());
            formDataSource.research(true);
        }
    }
}

public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = VendRORReturnNoteTrans;
    }

    return docCursor;
}

void init()
{
    super();

    if (element.args().dataset() == tableNum(PurchTable))
    {
        VendRORReturnNoteJour_ds.object(fieldNum(VendRORReturnNoteJour, InvoiceAccount)).visible(false);
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

public void run()
{
    super();

    if (element.args().dataset() == tableNum(VendRORReturnNoteTrans)
    &&  element.args().record())
    {
        lines.activatePage();
        VendRORReturnNoteTrans_ds.positionToRecord(element.args().record());
    }
}

void updateDesign(InventDimFormDesignUpdate _mode)
{
    PurchLine       purchLine;

    InventMovement  movement = InventMovement::construct(purchLine);

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init        :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }
        // Fall through

        case InventDimFormDesignUpdate::Active      :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public int active()
{
    int ret;

    ret = super();

    RORReturnNoteCancel.enabled(VendRORReturnNoteJour.PurchaseType != PurchaseType::RORSubRental && !VendRORReturnNoteJour.isCanceled());

    return ret;
}

public void init()
{
    QueryBuildDataSource    queryDataSourceLink;

    super();

    switch (element.args().dataset())
    {
        case tableNum(PurchTable) :
            this.query().dataSourceTable(tableNum(VendRORReturnNoteJour)).clearDynalinks();

            queryDataSourceLink = this.query().dataSourceTable(tableNum(VendRORReturnNoteJour)).addDataSource(tableNum(VendRORReturnNotePurchLink));
            queryDataSourceLink.relations(true);
            queryDataSourceLink.addDynalink(fieldNum(VendRORReturnNotePurchLink, OrigPurchId),
                                            element.args().record(),
                                            fieldNum(PurchTable, PurchId));
            break;

        case tableNum(smmBusRelTable):
            this.query().dataSourceTable(tablenum(VendRORReturnNoteJour)).clearDynalinks();

            queryDataSourceLink = this.query().dataSourceTable(tableNum(VendRORReturnNoteJour)).addDataSource(tableNum(VendTable));
            queryDataSourceLink.joinMode(JoinMode::ExistsJoin);
            queryDataSourceLink.addLink(fieldNum(VendRORReturnNoteJour, OrderAccount), fieldNum(VendTable, AccountNum));
            queryDataSourceLink.addDynalink(fieldnum(VendTable, Party),
                                            element.args().record(),
                                            fieldnum(smmBusRelTable, Party));
            break;
    }
}

public int active()
{
    int ret;

    unpostedInvoices.enabled(VendRORReturnNoteTrans.unpostedInvoicePurchQty() != 0);

    ret = super();

    return ret;
}

void clicked()
{
    VendRORReturnNoteJour localReturnNoteJour = VendRORReturnNoteJour.data();
    ;

    if(Box::yesNo("@DNR6672", DialogButton::No) == DialogButton::Yes)
    {
        super();

        refreshCaller = true;

        if(localReturnNoteJour.isCanceled())
        {
            info(strFmt("@DNR6674", localReturnNoteJour.ReturnNoteId));
        }
    }
}
